💜 المجموعة المستهدفة للعناية بالبشرة( Targeted skin care product)

📌تحتوي على:
💜 المقشر(Exfoliator)
يحتوي على المكونات الطبيعية حبيبات الجوجوبا ومسحوق الخيزران اللذان يعملان على ازالة الجلد الميت دون الاضرار به.ومضاف اليه زيت الليمون الذي يعمل على الترطيب العميق للبشرة ويحتوي ايضا على مستخلص الصنوبر الغني بفيتامين AوEوC واللذي يعمل على توحيد ملمس البشرة وتنعيمها ونضارتها .

💜 المنظف المتعادل (Balancing Toner)
يعمل على انعاش البشرة عن طريق ازالة الشوائب والاوساخ وتضيق المسامات  فهو يحتوي على مستخلص الخيار الذي يعمل على تلطيف وترطيب البشرة ويخفف تهيجها.ومضاف اليه الصبار والشاي الابيض ومستخلص عشب البحر حيث يعمل هذا المزيج الفريد على تنعيم البشرة وتوحيد لونها ويتركها نضرة شابة.

💜 كريم النهار الواقي من اشعة الشمس(Protecting Day Lotion )
يعمل كطبقة حماية للبشرة من اشعة الشمس الضارة حيث انه يحتوي على درجة عامل حماية عالية(SPF20) ويتكون من اكثر من 20 مادة مرطبة طبيعية واهمها الالوفيرا ومستخلص البطيخ والنبات.الذين يساعدون في عملية الاكسدةوبالتالي يحسن من شكل وملمس البشرة ويزودها بترطيب لامثيل له.

💜 كريم حول العين(Eye Awakening cream)
لعيون جميلة نضرة ومشرقة طوال اليوم جربوا كريم حول العينين .وبفضل تقنية الببتيدات والكولاجين ومكونات طبيعية اخرى يعملون على انتاج الكولاجين الطبيعي للبشرة وبالتالي التقليل من ظهور التجاعيد حول العين والهالات السوداء والانتفاخ.
